InternalContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract InternalContract {
    address private owner;
    address private doner;
    address private specialist;
    address private practitioner;
    address public reception;

    // Structure to define the structure of a quality contract
    struct OrganId {
        string donerName;
        uint256 dateDonated;
        string condition;
        string donatedTo;
        bool isConsented;
        bool isEvaluated;
        bool isStored;
        bool isAssigned;
    }

    struct RequestId {
        string patientName;
        bool isApproved;
    }

    mapping(uint256 => OrganId) public organs; // Store organ data by ID
    mapping (uint256 => RequestId) public requests;
    uint256 public organCount = 0; 
    uint256 public requestCount = 0;

    modifier onlyDonor() {
        require(msg.sender == doner, "Only the donor can consent.");
        _;
    }

    modifier onlySpecialist() {
        require(msg.sender == specialist, "Only a specialist can evaluate the organ.");
        _;
    }

    

    modifier onlyDoctor() {
        require(msg.sender == practitioner, "Only a doctor can assign the organ.");
        _;
    }

    modifier onlyReception() {
        require(msg.sender == reception, "Only a receptionist can create the invoice.");
        _;
    }

    constructor(address _doner,address _specialist, address _healthcare, address _doctor, address _reception) {
        doner = _doner;
        specialist = _specialist;
        practitioner = _doctor;
        reception = _reception;
        owner = msg.sender;
    }

    // Function 1: Donor agrees to consent
    function agreeToConsent(string memory _donerName, uint256 _donationDate) public onlyDonor {
        organCount++;
        organs[organCount] = OrganId(_donerName, _donationDate, "To be evaluated", "To be assigned", true, false, false, false);
    }

    // Function 2: Specialist evaluates the organ health
    function evaluateOrganHealth(uint256 _organId, string memory _condition) public onlySpecialist  {
        OrganId storage organ = organs[_organId];
        require(organ.isConsented, "Organ donation has not been consented.");
        require(organ.isEvaluated, "Organ health has been evaluated.");
        organ.condition = _condition;
        organ.isEvaluated = true;
        organ.isStored = true;
    }

    function requestOrgan(string memory _patientName) public onlyDoctor {
        requestCount++;
        requests[requestCount] = RequestId(_patientName, false);
    }

    // Function 3: Healthcare department stores the organ
    

    function generateInvoice(uint256 _requestId) external view onlyReception returns (string memory patient) {
        return requests[_requestId].patientName;
    }
}

